import { useState } from "react";
import NoteContext from "./notes/noteContext";

const NoteState = (props)=>{
    const state = {
        "name": "shashank",
        "class": "4a"
    }
    useState
    return (
        <NoteContext.Provider value = {state}>
            {props.children}
        </NoteContext.Provider>
    )

}
export default NoteState;
